import React from "react";
import "./style.css";

function TableData({ name, data }) {
  return (
    <div className="card-cell">
      <b className="card-cell-key">{name}</b>
      <div className="card-cell-value">
        {data.map((item) => (
          <p>{item}</p>
        ))}
      </div>
    </div>
  );
}

export default TableData;
